import React from 'react';
const Profile = () => {
    return ( 
      <div>
          <div>
              <div  style={{display:"flex",justifyContent:"spacearound",margin:"18px 0px"}}>
                  <img style={{width:"150px",height:"150px",borderRadius:"75px"}} 
                  src="https://images.unsplash.com/photo-1509479200622-4503f27f12ef?ixlib=rb-1.2.1&ixid=eyJhcHBfaWQiOjEyMDd9&auto=format&fit=crop&w=500&q=60" />
              </div>
              <div>
                  <h4>Joker</h4>
              </div>
          </div>
      </div>  
     );
}
 
export default Profile;
